import React, { FC } from 'react';
import { Routes } from './Routes';

const App: FC = () => {

    return (
        <div className={classes.app}>
            <header className={classes.header}>
                <Header />
            </header>
            <body className={classes.body}>
                <Body />
            </body>
            <footer className={classes.footer}>
                <Footer />
            </footer>
            <Routes />
        </div>

    );
}

export default App;
